import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './Navbar';
import Home from './Home';
import About from './About';
import Login from './Login';
import Logout from './Logout';
import Profile from './Profile';

const App = () => {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  const handleLogin = () => {
    // Perform login actions (e.g., API calls, set authentication tokens)
    // After successful login, set isLoggedIn to true
    setIsLoggedIn(true);
  };

  const handleLogout = () => {
    // Perform logout actions (e.g., clear authentication tokens)
    // After successful logout, set isLoggedIn to false
    setIsLoggedIn(false);
  };

  return (
    <Router>
      <Navbar isLoggedIn={isLoggedIn} handleLogout={handleLogout} />
      <Switch>
        <Route exact path="/" component={Home} />
        <Route path="/about" component={About} />
        <Route path="/login">
          <Login handleLogin={handleLogin} />
        </Route>
        <Route path="/logout" component={Logout} />
        <Route path="/profile" component={Profile} />
      </Switch>
    </Router>
  );
};

export default App;
